    LexicalComposer, 
    PlainTextPlugin, 
    ContentEditable
} from 'lexical'


export default function Editor() {
    const textEditorConfig = {
        namespace: 'TextEditor',
        theme: {
    
        },
        onError: console.error
    };

    return (
      <LexicalComposer initialConfig = {textEditorConfig}>
        <PlainTextPlugin
            contentEditable={<ContentEditable/>}
        />
      </LexicalComposer>  
    );
}
